By default, the output of all sub-tracks will be fed into the input of the main mixer track without any volume change. It can be useful to customize this behavior. Let's say we want to be able to control the volume level of gameplay sounds separately from music. We may also want to apply effects to gameplay sounds that come from the player specifically. We'll end up with a hierarchy like this: ┌──────────┐ │Main track│ └─▲──────▲─┘ │ │ │ │ ┌────┴─┐ ┌┴────┐ │Sounds│ │Music│ └──▲───┘ └─────┘ │
┌──────┴──────┐
│Player sounds│
└─────────────┘ We can set up the sounds and player_sounds hierarchy using TrackRoutes. # extern crate kira;
# use std::error::Error;
use kira::{ manager::{ AudioManager, AudioManagerSettings, backend::cpal::CpalBackend, }, track::{TrackRoutes, TrackBuilder},
}; let mut manager = AudioManager::<CpalBackend>::new(AudioManagerSettings::default())?;
let sounds = manager.add_sub_track(TrackBuilder::default())?;
let player_sounds = manager.add_sub_track( TrackBuilder::new().routes(TrackRoutes::parent(&sounds)),
)?;
# Result::<(), Box<dyn Error>>::Ok(()) The default TrackRoutes has a single route to the main mixer track. TrackRoutes::parent will instead create a single route to the track of your choosing. You can also have one track feed its audio into multiple other tracks. This can be useful for sharing effects between tracks. For example, let's say we have our sounds split up into player sounds and ambience. This game takes place in a vast cave, so we want all of the sounds to have a reverb effect. We want the ambience to have more reverb than the player sounds so that it feels farther away. We could put separate reverb effects on both the player and ambience tracks. Since both the player and the ambient sounds are in the same cave, we'll use the same settings for both reverb effects, but we'll increase the mix setting for the ambience, since ambient sounds are supposed to have more reverb. This has some downsides, however: Since most of the settings are supposed to be the same between the two tracks, if we want to change the reverb settings, we have to change them in two different places. We have two separate reverb effects running, which has a higher CPU cost than if we just had one. A better alternative would be to make a separate reverb track that both the player and ambience tracks are routed to. ┌──────────┐ ┌────►Main track◄───────┐ │ └─▲────────┘ │ │ │ │ │ │ ┌───┴──┐ │ ┌────┼────────────►Reverb│ │ │ │ └──▲───┘ │ │ │ │ │ │ │ │
┌──┴─┴─┐ │ ┌────────┐ │
│Player│ └───┤Ambience├──┘
└──────┘ └────────┘ Here's what this looks like in practice: # extern crate kira;
# use std::error::Error;
use kira::{ manager::{ AudioManager, AudioManagerSettings, backend::cpal::CpalBackend, }, track::{ TrackRoutes, TrackBuilder, effect::reverb::ReverbBuilder, },
}; let mut manager = AudioManager::<CpalBackend>::new(AudioManagerSettings::default())?;
let reverb = manager.add_sub_track({ let mut builder = TrackBuilder::new(); builder.add_effect(ReverbBuilder::new().mix(1.0)); builder
})?;
let player = manager.add_sub_track( TrackBuilder::new().routes(TrackRoutes::new().with_route(&reverb, 0.25)),
);
let ambience = manager.add_sub_track( TrackBuilder::new().routes(TrackRoutes::new().with_route(&reverb, 0.5)),
);
# Result::<(), Box<dyn Error>>::Ok(()) Let's look at this one step at a time: let reverb = manager.add_sub_track({ let mut builder = TrackBuilder::new(); builder.add_effect(ReverbBuilder::new().mix(1.0)); builder
})?; We create the reverb track with a Reverb effect. We set the mix to 1.0 so that only the reverb signal is output from this track. We don't need any of the dry signal to come out of this track, since the player and ambience tracks will already be outputting their dry signal to the main track. let player = manager.add_sub_track( TrackBuilder::new().routes(TrackRoutes::new().with_route(&reverb, 0.25)),
); We create the player track with two routes: The route to the main track with 100% volume. We don't have to set this one explicitly because TrackRoutes::new() adds that route by default. The route to the reverb track with 25% volume. let ambience = manager.add_sub_track( TrackBuilder::new().routes(TrackRoutes::new().with_route(&reverb, 0.5)),
); The ambience track is set up the same way, except the route to the reverb track has 50% volume, giving us more reverb for these sounds.

